import React from "react";
import produtos from "../../produtos/produtos";
import InputBusca from "../input/InputBusca";
import { ConteinerStyle, CamisetaStyle } from "./style";


function HomePage ({busca,setBusca}){

    const onChangeBusca =(event)=>{
        setBusca(event.target.value)
    }

    const onClickBuscar= () => {
         const buscarItem = busca
        console.log(buscarItem)
        setBusca("")
     }

    {listaDeProdutos = produtos
        .filter((item)=>{
            return item.nome.includes(busca)
        })
        .map((item)=>{return
        <CamisetaStyle>{item.id} {item.nome} {item.foto} {item.valor} {item.botao}  </CamisetaStyle>
    })}

    return(

        <div>
         <InputBusca 
         busca = {busca}
         onChangeBusca= {onChangeBusca}
         onClickBuscar ={onClickBuscar}>
        </InputBusca> 
        <ConteinerStyle></ConteinerStyle>
        </div>
    )
}


export default HomePage
